import React from 'react';

class Question extends React.Component {
  render () {
    testFunc = () => {
      console.log("hello")
    }
    return (
      <div>
        <h5>{this.props.question}</h5>
        <button onClick={testFunc}>True</button>
        <button onClick={() => console.log('momo')}>False</button>
      </div>
    )
  }

}

export default Question;
